import { Dialog, Box, TextField, Typography, Button, styled } from '@mui/material';

const Component = styled(Box)`

`;

const LoginDialog = ({open, setOpen}) => {
    const handelClose = () => {
        setOpen(false); 
    }
    return (
            
            <Dialog open = {open} onClose={handelClose}>
                <Component>
                    <Box></Box>
                    <Box>
                        <TextField vareint="standard" label="Enter Email/Mobile number"/>
                        <TextField vareint="standard" label="Enter Password"/>
                        <Typography>By continuing, you agree to flipkart's Terms of use and Privacy Policy.</Typography>
                        <Button>Login</Button>
                        <Typography>OR</Typography>
                        <Button>Request OTP</Button>
                        <Typography>New to Flipkart? Create an account</Typography>
                    </Box>
                </Component>
            </Dialog>
    )
}

export default LoginDialog;
